import React from 'react';
import { Row, Col } from 'react-bootstrap';
import 'components/SetlistResult/SetlistResult.css';

const setlistResult = (props) => {
        let locationString = 'Unknown';
        if(props.venueName || props.cityName || props.stateName || props.countryName){
            locationString = props.venueName;
            if(props.cityName){
                locationString.concat(', ', props.cityName);
                console.log(locationString);
            }
            if(props.stateName){
                locationString.concat(', ', props.stateName);
            }
            if(props.countryName){
                locationString.concat(', ', props.countryName);
            }
            console.log(locationString);
        }

        return(
            <Row className="setRow mb-4">
                <Col md={{ span: 6, offset: 3}} className="setlistResult">
                    <Row>
                        <Col lg={{ span: 2 }} md={{ span: 12 }}>
                        <div className="dateBlock">
                            <span className="month">Jan</span>
                            <span className="day">1</span>
                            <span className="year">2020</span>
                        </div>
                    </Col>

                    <Col lg={{ span: 10 }} md={{ span: 12 }}>
                        <span className="artistName">{props.artistName}</span>
                    <div className="venue">{locationString}</div>
                    <div className="numSongs">{props.setSize} songs</div>
                    </Col>
                    </Row>

                </Col>
            </Row>
        )
}

export default setlistResult;
